import React, { useState } from 'react'
import  { AppBar, Button, Tab, Tabs, Toolbar, Typography } from '@mui/material';
import StorefrontRoundedIcon from '@mui/icons-material/StorefrontRounded';
import LoginIcon from '@mui/icons-material/Login';
import LogoutRounded from '@mui/icons-material/LogoutRounded';

const Header = () => {
   const [ value, setValue] = useState();

  return (
    <React.Fragment>
        <AppBar sx = {{ background: "#800000"}}>

            <Toolbar>
                <StorefrontRoundedIcon />
                
                    <Tabs textColor="inherit" value={value} onChange={(e,value)=> setValue(value)} indicatorColor="secondary">
                    <Tab label ="PRODUCTS" />
                    <Tab label ="SERVICE" />
                    <Tab label ="CONTACT US" />
                    <Tab label ="HELP & SUPPORT" />
                </Tabs>

                <Button sx={{marginLeft:"auto" , background:"#800000" }} variant='contained' >
                  Login{""}
                </Button>
                <Button sx={{background:"#800000" , marginLeft: "10px"}} variant='contained' >
                  SIGN UP{""}
                </Button>
               
              
            </Toolbar>
        </AppBar>
    </React.Fragment> 
  )
}

export default Header;
